column8:
ARC'TERYXが提案するトラベルパック向けのオーガナイザー<br><br>

背面がメッシュパネルで通気と中身の確認が可能な構造、しなやかなナイロン製のライトウエイトオーガナイザーです、下着類やトイレタリー用品を小分け収納するのに良いサイズです。<br><br>


・素材：N210p type 6 nylon plain weave ( ナイロン 100％ )<br>
・サイズ：27.94cm×19cm×8.89cm<br>
・カラー：Carbon Copy<br>
・容量：5L<br>
・重量：70g<br>
・原産国：ベトナム<br><br>

